import styled from "styled-components";

const Tema1_2 = styled.div`
background: #26273D;
min-height: 100%;
min-height: 100vh;
overflow: auto;    
`;

const Tema1_2_H1 = styled.h1`
background: #A3A7B0;
color: #A3A7B0;
`;

console.log("TESTE");

export default {Tema1_2, Tema1_2_H1};
